    myRole: 'Software Engineer',
    team: 'Two Engineers and One Front-End Designer',
    technology: 'Java, HTML, and CSS',
    content: '<hr><h2>Introduction</h2><p>For our first hackathon, we wanted to solve a problem that would affect the immediate community around us.</p><p>As a Freshman, the famous Rutgers bus system was something that took me a long time to figure out. At the beginning of the semester, I would be waiting at the bus stop ready to go to my 4:30 pm class on College Avenue to find that there was no space on the buses that would take me straight to College Avenue. At this point, I had to find another route through a different campus that would take me to where I needed to be. So I sat at the bus stop, scrolling through a bus stop list on the Rutgers bus app. While I did end up finding a route, this method tedious and time-consuming.</p><p>The problem that I had run into is something that my entire team faced during their first few weeks at Rutgers, so our team decided to make an application that would solve this problem.</p><p>RUNav is an app aimed at receiving the name of the two bus stops you want to travel between and returning all active buses running between those stops.</p><hr><h2>Process</h2><p>Almost as soon as we had finished brainstorming ideas about how we would implement our thoughts, we started working. We began by coding the bus stop objects and making 2D arrays to simulate each route. Eventually, we realized that using 2D arrays to reproduce all the paths between bus stops was going to take a painstakingly long time, and one bug would probably talk us hours to find, so we regrouped to see if there was a better way to go about getting all the routes. Through the help of a mentor at HackRU, we found out about APIs. Rutgers is using a Transloc API that contained data on not only the different routes, but also whether a bus was active, the arrival time, and the position of the bus.</p><p>With this information available to us, the logic for our app became more straightforward, and I came up with an algorithm that parsed the list of buses and bus routes, stored the associated routes and buses in a hashtable, searched through the hashtable for matches, and returned the active buses.</p><p>Our front-end designer created a front-end for the app using HTML and CSS. We, however, did not know how to connect the back-end and the front-end of the app. And due to the hackathon&apos;s time constraints, we could not learn and experiment with our app. Therefore, we demoed the back-end and front-end separately.</p><hr><h2>Looking Back</h2><p>RUNav was my first hackathon project, and it was also the first time I worked with a group of people to create a product.</p><p>Through this project, I realized the importance of thoroughly flushing out your ideas and ask questions before you begin coding. A question as simple as "how are we going to get the data required for the routes?" may have prompted a conversation about if hardcoding our data is the best way. Such questions would have exempted us from trying to hardcode our data and saved us some time.</p><p>When we demoed our app, some of the feedback we got had to do with our programming language choice. The judges asked us to consider if there was another programming language that could make this program easier to enact. It was then that we realized that we tried to make the project fit into what we knew instead of thinking about the best way to implement it. Because of this mindset, even though our program works, it takes an extremely long time to work, meaning that my algorithm has a terrible BigO (O(n^2), I think).</p><p>This project was my first encounter with an API, and during the hackathon, I can say that we did not use the API to its fullest potential. There was so much data inside the API, yet we only used two fields. As I was looking through the code a couple of days after the hackathon, I realized we could enhance our app in so many ways with the API&apos;s data.</p><hr><h2>Looking Ahead</h2><p>1. Use a graph to map the different routes</p><p>2. Integrate the back-end and front-end</p><p>3. Add more functionality such as calculating the time it takes to get between stops</p>',
